import { Link } from "react-router-dom";
import "../css/navigation.css";
import logo from "../logos/bransome.png";
const Navigation = () => {
  return (
    <nav id="nav_box">
      <header>
        <Link to="/">
          <img src={logo} />
        </Link>
      </header>
      <section className="nav_links">
        <Link to="/brand">
          <div>brands</div>
        </Link>
        <Link to="/best20">
          <li>best20</li>
        </Link>
      </section>
    </nav>
  );
};

export default Navigation;
